import {
  createStore,
  applyMiddleware
} from "redux";

import logger from "redux-logger";
import thunk from "redux-thunk";

const middleware ={
  logger,
  thunk
}
const Storage = createStore(()=>{},{},applyMiddleware(middleware));

export default Storage;
